Step 1: Psychological Mechanisms

• The decision to accept a proposal is assumed to be based on comparing the actual offer (split_self) with an internal fairness benchmark. This internal fairness benchmark is not fixed but learned over the course of many trials.  
• The fairness benchmark is calculated as a proportion (f) of the total amount available (combined_earning). When the offered share exceeds this expected fair share, the participant is more likely to accept.  
• In addition, differences in the relative contributions of the participant versus the opponent (token_self minus token_opp) may influence acceptance: a higher relative contribution may soften rejection even for a given offer.  
• An intercept parameter is added to capture any systematic bias in acceptance.  
• All these effects are combined linearly into a utility value which is then passed through a logistic function to yield a continuous prediction (between 0 and 1) that approximates the probability (or, with MSE, a numerical value) of accepting.

Step 2: Mathematical Form

A minimal model has four learnable parameters:
• a (intercept),
• beta (sensitivity to the fairness deviation of the offer from the learned fair share), 
• gamma (sensitivity to the relative contribution, token_self − token_opp),
• f (learned expectation of a fair share as a proportion of combined_earning, bounded between 0 and 1).

The fairness deviation is computed as (split_self − f · combined_earning). Then the latent utility is linear in this deviation and relative contributions. Finally, a logistic transformation is applied to compress the output into the [0,1] interval.

Below is the formal specification.

<MODEL>
accept_hat = 1/(1+exp(-(a + beta*(split_self - f*combined_earning) + gamma*(token_self - token_opp))))
</MODEL>

